import React, { Component } from 'react';
import Subject from "./components/Subject"
import Listt from "./components/Listt"
import './App.css';

class App extends Component {  
  render(){
    return (
      <div className="App">
        <Subject bigtitle="Hello" smalltitle="react is very nice!!"></Subject>
        <Subject bigtitle="oh" smalltitle="i agree that!"></Subject>
        <Listt></Listt>
      </div>
    );
  }
}

export default App;
